import React, {ReactNode} from "react";
import Proposal from "./Proposal";
import '../../css/SearchBar.css';

class ProposalList extends React.Component<any, any> {
    public render(): ReactNode {
        return (
            <div
                className={'proposal-list rounded offset-0 col-10 mt-sm-5 pt-sm_5 ml-sm-4'}
            >
                <ul>
                    <li><Proposal key={1}/></li>
                    <li><Proposal key={2}/></li>
                </ul>
            </div>
        );
    }
}

export default ProposalList;
